import React from 'react'

function Search({searchFilter}) {
  return (
     <div className="center">
    <form>
    <input
      type="text"
      placeholder="Search..."
      onChange={(e) => searchFilter(e)}
    />
    </form>
  </div>
  )
}

export default Search
